import {LOCALES} from '../locales';

export default{
    [LOCALES.ENGLISH]:{
        'hello': 'Hello',
        'about' : 'About Us',
        'cute': 'Cute pet is a non-profit, community-based organization and a registered charitable organization.This organization enforced the new animal protection laws and focused on bettering the lives of nelected pets by lobbying for legislation to provide for foster homes.',
        'ap' :'Adoption Process',
        'step1':'Step1: Click the Adoption button on the top right to browse all categories of pets',
        'step2':'Step2: Choose the type of pets that you are interested in',
        'step3':'Step3: Browse all our pets, click button or picture to reserve an appointment',
        'step4':'Step4: Please click Help for more information',
        'cutepet': 'Cute Pet'
    }
}
